class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        picks = []
        for i in range(len(board)):
            cur = []
            for j in range(len(board[0])):
                cur.append([board[i][j], i, j])
            cur.sort(reverse=True)
            picks.extend(cur[:3])
        picks.sort(reverse = True)
        res = -float("inf")
        for i in range(min(4, len(picks))):
            cur, a, b = picks[i]
            for j in range(len(picks)):
                cur1, a1, b1 = picks[j]
                if a1 == a or b1 == b:
                    continue
                for k in range(len(picks)):
                    cur2, a2, b2 = picks[k]
                    # print(a,b,a1,b1,a2,b2)
                    if len(set([a,a1,a2]))==3 and len(set([b,b1,b2])) == 3:
                        # print(a,b,a1,b1,a2,b2, res)
                        res = max(res, cur+cur1+cur2)
        # print(picks)
        # print(res)
        return res
